import { MultiSelect } from "primereact/multiselect";
import { useState } from "react";

const distributionListSelectItems = [
    { label: "New York", value: "NY" },
    { label: "Rome", value: "RM" },
    { label: "London", value: "LDN" },
    { label: "Istanbul", value: "IST" },
    { label: "Paris", value: "PRS" },
  ];

const DistributionList = (props) => {
  const [distributionListValue, setDistributionListValue] = useState("");

  return (
    <div>
        <h1>Verteilerlisten</h1>
        <MultiSelect value={distributionListValue} options={distributionListSelectItems} onChange={setDistributionListValue} />
    </div>
  );
};

export default DistributionList;
